import "./App.css";
import Navbar from "./components/Navbar";
import Table from "./components/Table";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { useState, useEffect } from "react";
import EditContact from "./pages/EditContact";
import Footer from "./components/Footer";
import About from "./pages/About";

function App() {
  const [contacts, setContacts] = useState([
    {
      id: 0,
      firstName: "Albert",
      lastName: "Qi",
      email: "albertqiisthebest@college.harvard.edu",
      phoneNumber: "111-111-1111",
      houseYard: "Maple Yard",
      suite: "Inn 999",
      classYear: "First-Year",
      homeCity: "Needham",
      homeState: "MA",
      contactStatus: "Contacted",
      pteStatus: "PTE",
      registrationStatus: "Registered",
      stageOfVotingProcess: "Done",
      whereRegistered: "MA",
    },
    {
      id: 1,
      firstName: "Prat",
      lastName: "Mallick",
      email: "pratyushmallick@college.harvard.edu",
      phoneNumber: "111-111-1111",
      houseYard: "Maple Yard",
      suite: "Inn #",
      classYear: "First-Year",
      homeCity: "Needham",
      homeState: "MA",
      contactStatus: "Contacted",
      pteStatus: "PTE",
      registrationStatus: "Registered",
      stageOfVotingProcess: "Done",
      whereRegistered: "MA",
    },
  ]);

  // Fetch Contacts
  useEffect(() => {
    const fetchContacts = async () => {
      const res = await fetch("http://localhost:5000/contacts");
      const data = await res.json();

      console.log(data);
    };s

    fetchContacts();
  }, []);

  const header = [
    "First Name",
    "Last Name",
    "Email",
    "Phone Number",
    "House/Yard",
    "Suite",
    "Class Year",
    "Home City",
    "Home State",
    "Contact Status",
    "PTE Status",
    "Registration Status",
    "Stage of Voting Process",
    "Where Registered",
    "Actions",
  ];

  const [contact, setContact] = useState(contacts[0]);
  console.log(contact);

  // Edit Contact
  const editContact = (id) => {
    console.log(contact, id);
  };

  // Delete Contact
  const deleteContact = (id) => {
    setContacts(contacts.filter((contact) => contact.id !== id));
  };

  return (
    <Router>
      <Navbar />
      <Routes>
        <Route
          path="/"
          exact
          element={
            <>
              {contacts.length > 0 ? (
                <Table
                  tableHeader={header}
                  contacts={contacts}
                  onEdit={editContact}
                  onDelete={deleteContact}
                />
              ) : (
                <h3>No Contacts</h3>
              )}
            </>
          }
        />
        <Route
          path="/edit-contact"
          element={<EditContact contact={contact} />}
        />
        <Route path="/about" element={<About />} />
      </Routes>
      <Footer />
    </Router>
  );
}

export default App;
